import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Counter from './features/counter/Counter';




function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path='/' component={Counter}/>
      </Router>
    </div>
  );
}

export default App;
